import React from "react";
import "./App.css";
import Card from "./Componentes/Card";
import Primera from "./Componentes/primera2.jpg";
import CardDias from "./Componentes/CardDias";

function App() {
  const ejercicios = [
    {
      texto1: "Bicicleta",
      texto2: "Eliptico",
      texto3: "Cinta",
      texto4: "Abdominales",
      texto5: "Sentadillas",
      texto6: "Estocadas"
    },
  ];
  const imagenes=[
    {
      img: Primera,
      title: "LUNES",
      color: "#00FFFF",
    },
    {
      img: Primera,
      title: "Martes",
      color: "#00FFFF",
    }
  ]

  return (
    <div>
      {ejercicios.map(card => {
        return (
          <Card
            texto1={card.texto1}
            texto2={card.texto2}
            texto3={card.texto3}
            texto4={card.texto4}
            texto5={card.texto5}
            texto6={card.texto6}
          ></Card>
        );
      })}
      {imagenes.map(card => {
        return (
          <CardDias
            title={card.title}
            color={card.color}
            img={card.img}
          ></CardDias>
        );
      })}
    </div>
  );
}

export default App;
